<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Олимпиада Геннадиевна Терентьева родится четырнадцатого февраля 2769. <br><p>Двадцать четвертого сентября 2031 устроится на работу в Фонд на должность дипломата. </p><p>	Окончательно уволится двенадцатого октября 2781. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
